### Summary of Core Topics, Concepts, Principles, and Equations

#### Core Topics and Concepts

1. **Functions and Their Properties**
   - **Differentiability and Continuity**: Understanding the conditions under which a function is differentiable and continuous at specific points.
   - **Function Composition**: Understanding how to compose functions and find their domains.
   - **One-to-One Functions**: Identifying functions that are one-to-one (injective).

2. **Limits and Their Evaluation**
   - **Limit Theorems**: Applying limit theorems to evaluate limits of functions.
   - **Indeterminate Forms**: Handling indeterminate forms like \( \frac{0}{0} \) and \( \frac{\infty}{\infty} \).

3. **Sequences and Their Limits**
   - **Sequence Definition**: Understanding the definition and properties of sequences.
   - **Limit of Sequences**: Evaluating the limit of sequences, especially those involving exponential and polynomial terms.

4. **Exponential and Logarithmic Functions**
   - **Properties of Exponential Functions**: Understanding the properties and behavior of exponential functions.
   - **Properties of Logarithmic Functions**: Understanding the properties and behavior of logarithmic functions.

5. **Differentiation and Tangents**
   - **Derivatives**: Finding the derivatives of functions and using them to determine the equations of tangents.
   - **Differentiability Conditions**: Understanding the conditions under which a function is differentiable.

#### Important Equations and Principles

1. **Differentiability Condition**
   - For a function \( f(x) \) to be differentiable at a point \( x = a \), the left-hand derivative and the right-hand derivative must be equal at that point.
   - Example: \( f(x) = a \sin|x| + b e^{|x|} \) is differentiable at \( x = 0 \) if and only if \( a + b = 0 \).

2. **Limit Evaluation**
   - Example: \( \lim_{x \to 0} \left( \frac{(1 + x)^{\frac{1}{x}} - (1 - x)^{\frac{1}{x}}}{x} \right) = \frac{4}{5} \).

3. **Sequence Limit**
   - Example: For a sequence \( a_n = \frac{27n^7 + 25n^5 + 2n^8 + n}{4n^2 + 2n + 10n^3 + 5n^4 + n} \), the limit as \( n \to \infty \) is evaluated by considering the highest power terms.

4. **Exponential Equation Solutions**
   - Example: The equation \( e^{2x} - 9e^x = -18 \) can be transformed into a quadratic equation to find the number of solutions.

5. **Logarithmic Equation Solutions**
   - Example: Solving \( \log_2(x+1) - \log_4(x-3) = 2 \) involves converting logarithms to a common base and solving the resulting equation.

6. **Function Composition and Domain**
   - Example: For functions \( f(x) = \sqrt{x+5} \) and \( g(x) = x^2 - 5 \), the domain of \( g \circ f \) is \( [-\frac{1}{3}, \infty) \).

7. **Tangent Line Equation**
   - Example: For the function \( f(x) = x\sqrt{25 - x^2} \), the tangent line at \( x = 3 \) has a slope \( m = \frac{7}{4} \) and y-intercept \( c = \frac{27}{4} \).

